text:
for the ladies::
shame. hiding. insecurities. comparison. jealousy. painful marks of the exchange we have given into over the years. somewhere we stopped believing we were enough or started to think we were too much. somewhere along the way we judged someone for being confident because we didn't have any confidence of our own. we might have been told "dont be beautiful or sexy because it would "cause someone to stumble". and maybe not in those words but that's how the message was received. you are beautiful but don't act like you know it. shame shame, that's the game.
 my 9 year old #metoo experience told me how beautiful i would be. so 20 years later, i found the moment i exchanged my confidence, my self worth, i found where i had handed it over to instead hide, downplay, and cower. because i didn't want him to be right. i flipped the bird to that moment and took back what was rightfully mine. i took back what was my god given honor - to be a confident woman. i took back my confidence, my ability to say "thank you" for a compliment instead of "______ insert awkward excuse here". i took back the head and heart knowledge that my body is a temple and one that won't be defined by an event 20 years ago. i took back the ability to enjoy being feminine in my own way without downplaying it. so girl, find your moment and tell it off. get your healing and start living in that confidence you want so bad. because, you're worthy, because you were born to be confident, you, just as you are, are enough. ‚úåüèΩ

